const LabTest = () => {
    return (
        <div className="container mx-auto mt-10">
            <h1 className="text-3xl font-bold">Lab Test Information</h1>
            <p className="mt-4">This is where you can provide lab test information.</p>
            {/* Add more details about lab tests here */}
        </div>
    );
};

export default LabTest;
